import Head from 'next/head';

function HomePage() {
    return(
        <div>
            <Head>
                <title>Michael Gillett's website</title>
            </Head>
            <div>
                <h1>Welcome</h1>
                <p>To my nightmare</p>
                <p>again, baby</p>
            </div>
        </div>
    );
}

export default HomePage;
